import React from "react";
import "../App.css";
import "./signupform.css";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import FormControlLabel from "@mui/material/FormControlLabel";
import TextareaAutosize from "@mui/base/TextareaAutosize";
import Checkbox from "@mui/material/Checkbox";
import Link from "@mui/material/Link";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import Divider from "@mui/material/Divider";
import { createTheme, ThemeProvider } from "@mui/material/styles";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="rgb(216, 216, 216)"
      align="center"
      {...props}
    >
      {"Copyright © "}
      <Link color="inherit" href="/">
        CMP
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const extra = {
  "& .MuiInputLabel-root": { color: "white" }, //styles the label
  "& .MuiOutlinedInput-root": {
    "& > fieldset": { borderColor: "white" },
  },
  "& .MuiOutlinedInput-root:hover": {
    "& > fieldset": {
      borderColor: "#C4C4C4",
    },
  },
  input: { color: "white" },
  multilineColor: { color: "red" },
};

const theme = createTheme({
  palette: {
    primary: {
      main: "#ffebee",
    },
    secondary: {
      main: "#cfd8dc",
    },
  },
  color: "#cfd8dc",
});

export default function signupform() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get("email"),
      password: data.get("firstName"),
      description: data.get("description"),
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <div className="form-container">
        <div className="boxform">
          <Container component="main" maxWidth="md">
            <CssBaseline />
            <Grid
              container
              spacing={2}
              direction="column"
              justifyContent="flex-start"
            >
              <Grid item xs={12} container spacing={2}>
                <Grid item xs={6}>
                    <div className="sendform">
                  <Box
                    sx={{
                      marginTop: 0,
                      display: "flex",
                      flexDirection: "column",
                      alignItems: "center",
                    }}
                  >
                    {/* <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}></Avatar> */}
                    <Typography
                      component="h1"
                      variant="h5"
                      color="rgb(216, 216, 216)"
                    >
                      Send us a message
                    </Typography>
                    <Box
                      component="form"
                      noValidate
                      onSubmit={handleSubmit}
                      sx={{ mt: 3 }}
                    >
                      <Grid container spacing={2}>
                        <Grid item xs={12} sm={6}>
                          <TextField
                            autoComplete="given-name"
                            name="firstName"
                            required
                            fullWidth
                            id="firstName"
                            label="First Name"
                            autoFocus
                            sx={extra}
                          />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                          <TextField
                            required
                            fullWidth
                            id="lastName"
                            label="Last Name"
                            name="lastName"
                            autoComplete="family-name"
                            sx={extra}
                          />
                        </Grid>
                        <Grid item xs={12}>
                          <TextField
                            required
                            fullWidth
                            id="email"
                            label="Email Address"
                            name="email"
                            autoComplete="email"
                            sx={extra}
                          />
                        </Grid>
                        <Grid item xs={12}>
                          <TextField
                            multiline={true}
                            fullWidth
                            rows={3}
                            id="description"
                            name="description"
                            label="Description"
                            placeholder="Description"
                            autoComplete="Description"
                            variant="outlined"
                            sx={extra}
                            inputProps={{
                              style: { color: "white", height: "200px" },
                            }}
                            //   value={description}
                            //   onChange={(e) => setDescription(e.target.value)}
                          />
                        </Grid>
                        {/* <Grid item xs={12}>
                    <FormControlLabel
                      control={
                        <Checkbox
                          value="allowExtraEmails"
                          color="primary"
                          style={{
                            color: "#c6c6c6",
                          }}
                        />
                      }
                      label="I want to receive inspiration, marketing promotions and updates via email."
                    />
                  </Grid> */}
                      </Grid>
                      <Button
                        id="submitb"
                        type="submit"
                        variant="outlined"
                        fullWidth
                        sx={{ mt: 3, mb: 2 }}
                      >
                        Submit
                      </Button>
                      <Grid container justifyContent="flex-end">
                        <Grid item>
                          <Link href="#" variant="body2">
                            FAQ?
                          </Link>
                        </Grid>
                      </Grid>
                    </Box>
                  </Box>
                  </div>
                </Grid>
                <Grid item xs={1}></Grid>

                <Grid item xs={5}>
                  <div className="ourinformation">
                    <div>&emsp;</div>
                    <div className="information">
                      <div className="infoheading">Contact Information</div>
                      <div className="subinfoheading">
                        Fill up the form and our team will get back to you in 24
                        hours
                      </div>
                      <div className="info">
                        <i class="fas fa-address-book"></i>
                        &emsp;
                        <Link to="/">+828 32232</Link>
                      </div>
                      <div className="info">
                        <i class="fas fa-envelope"></i>&emsp;
                        <Link to="/">aaaaa@gmail.com</Link>
                      </div>
                      <div className="info">
                        <i class="fab fa-instagram"></i>&emsp;
                        <Link to="/">CMP</Link>
                      </div>
                    </div>
                  </div>
                </Grid>
              </Grid>
            </Grid>

            <Copyright sx={{ mt: 5 }} />
          </Container>
        </div>
      </div>
    </ThemeProvider>
  );
}

